import React from 'react'
import PropTypes from 'prop-types'
const Button = (props) => {

    function onclick() {
        prompt("Helo");
    }

  return (
    <button className='btn' style={{backgroundColor : props.color }} onClick={onclick}>{props.text}</button>
  )
}

export default Button

Button.defaultProps = {
    color : 'steelblue' ,
}

Button.prototype= {
    color : PropTypes.string , 
    text : PropTypes.string , 
}
